class ResultImporterSpreadsheetTest extends PHPUnit_Framework_TestCase {
	
	// variables
	private $fileName;
	private $fileContent;
	
	// setup
	public function setUp() {
		
		// set variables
		$this->fileName = '../../tmp/tempfile';
		$this->fileContent = ' ';
		
		// write to file
		$fp = fopen($this->fileName, 'wb');
		fwrite($fp, base64_decode($this->fileContent));
		fclose($fp);
	}
	
	
	public function tearDown() {
		
		// remove file
		unlink($this->fileName);
	}
	
	
	public function testFactory() {
		
		// prepare data
		$type = 'spreadsheet';
		$phpExcel = PHPExcel_IOFactory::load($this->fileName);
		$fileContent = $phpExcel->getActiveSheet()->toArray(null, true, true, true);
		
		// call factory type given
		$importer = ResultImporter::factory($this->fileName, $type);
		
		$type = ucfirst(strtolower($type));
		$this->assertInstanceOf('ResultImporter'.$type, $importer);
		$this->assertEquals($this->fileName, $importer->getFileContent());
		$this->assertTrue(is_array($importer->getResultStore()));
		
	}
	
	
	public function testAnalyzeFormat() {
		
		// prepare data
		$type = 'spreadsheet';
		$phpExcel = PHPExcel_IOFactory::load($this->fileName);
		$fileContent = $phpExcel->getActiveSheet()->toArray(null, true, true, true);
		
		// call factory type given
		$importer = ResultImporter::factory($this->fileName, $type);
		
		$type = ucfirst(strtolower($type));
		$this->assertInstanceOf('ResultImporter'.$type, $importer);
		$this->assertEquals($this->fileName, $importer->getFileContent());
		$this->assertTrue(is_array($importer->getResultStore()));
		
		// validate file format
		$this->assertTrue($importer->validate());
		
		// test data from resultstore
		$data = $importer->getDataAsArray();
		$this->assertEquals(16, count($data));	
		for($i=7; $i<=count($fileContent); $i++) {	
			$this->assertEquals($fileContent[$i],
					array('A' => $data[$i-7]['place'], 'B' => $data[$i-7]['name'], 'C' => $data[$i-7]['weightclass'], 'D' => $data[$i-7]['agegroup'], 'E' => $data[$i-7]['club'])
				);
		}
	}
	
}
?>
